              Selamat datang di web apps authentication{" "}
            </p>
            <br/><br/>
            <div>
              <Link
                to="/register"
                style={{
                  width: "140px",
                  borderRadius: "5px",
                  letterSpacing: "1.5px"
                }}
                className="btn btn-large waves-effect waves-light hoverable blue accent-3">
                Register
